body:
5G is poised to radically change how people and devices connect. Its high capacity (20Gb per second peak data rates), low latency (&lt;1 millisecond), and massive connectivity implications (1mn connections per Km2) will not only deliver ultra-broadband services, like HD and ultra-HD video streaming, but also enable cellular to enter the world of autonomous vehicles, industrial sensors, and IoT devices.

&amp;#x200B;

Fifth-generation or 5G will be the next major iteration of the mobile industry’s technology evolution that started in the 1980s with 1G (voice-on ly). Every ge neration (2G, 3G, 4G/LTE) has boosted the download speeds on mobile devices enabling new data services. The last major transition from 3G to 4G kicked-off in 2008, su pport ingdownload speeds of \~1 Gigabit/second (Gb/s) in stationary and 100 Megabits/second (Mb/s) when the subscriber is mobile. 5G promises to provide a 10x+ jump, with peak download speeds over 10 Gb/s and mobile speeds exceeding 1 Gb/s. We expect very modest 5G smartphone sales in 2019, but believe the potential launch of a 5G iPhone in 2020 to be the incentive needed to jump-start this market. The ongoing tech-race between US, China could be an added catalyst. Our primer explores key offerings from infrastructure vendors such as Xilinx, Analog Devices, Marvell, Intel, Broadcom; an d handset chipmakers such as Qualcomm, Skyworks, Qorvo and MediaTek.

SHOP HD DELL

&amp;#x200B;

Last two companies will exist 10 years from now unless we get an actual apocalypse. SHOP may still outpace the market for years.
